import { Dropdown, Menu } from 'semantic-ui-react'
export const DropdownMenu = ()=>{
    const option = [
        { key: 1, text: '5', value: 5 },
        { key: 2, text: '10', value: 10 },
    ]

    return (
        <Menu compact>
            <Dropdown text='Dropdown' options={options} simple item />
        </Menu>
    )

}
